INSERT INTO `page_text` VALUES ('3611', 'When the flames consume Azeroth, where will you be?
INSERT INTO `page_text` VALUES ('3612', 'You\'ve no doubt heard the phrase "all good things must come to an end" and so it is with your life on Azeroth. It won\'t be long before the world erupts into chaos as the elements reclaim their birthright.
INSERT INTO `page_text` VALUES ('3613', 'We live in tumultuous times. War, invasion, and famine have swept the world, but the real trial is yet to come: the end of Azeroth itself.
INSERT INTO `page_text` VALUES ('3614', 'Citizens of Orgrimmar, beware the soothsayers and prophets of doom that have taken over our streets. Do not be taken in by their mad raving. They only want to weaken us in the face of our true enemies!', '0');
